export default class SocketTask {
    constructor(url: any, protocols: any);
    ws: WebSocket;
    CONNECTING: number;
    OPEN: number;
    CLOSING: number;
    CLOSED: number;
    get readyState(): number;
    send(obj?: {}): Promise<{
        errMsg: string;
    }>;
    close(obj?: {}): Promise<{
        errMsg: string;
    }>;
    closeDetail: {
        code: any;
        reason: any;
    } | undefined;
    onOpen(func: any): void;
    onMessage(func: any): void;
    onClose(func: any): void;
    onError(func: any): void;
}
